import { Component } from "@angular/core";
import { HttpClient } from '@angular/common/http';
import { GetBreedsService } from "src/app/shared/services/getBreeds.service";


@Component({
  selector: "app-breeds-list",
  templateUrl: "./breeds-list.component.html",
  styleUrls: ["./breeds-list.component.scss"],
})
export class BreedsListComponent {
  public breeds;

  constructor(private http: HttpClient, public getBreedService: GetBreedsService) {
    this.breeds = getBreedService.getBreeds().subscribe((data) => {
      console.log(data);

      this.breeds = data;
    });
  }

  public getPrevious(){
    this.breeds = this.getBreedService.getPreviousBreeds(this.breeds).subscribe((data) => {
      this.breeds = data;
    });
  }

  public getNext(){
    this.breeds = this.getBreedService.getPreviousBreeds(this.breeds).subscribe((data) => {
      this.breeds = data;
    });
  }
}
